import Link from 'next/link';

const linkStyle = {
  marginRight: 15
};

const Header = () => (
  <div className='wrap-header'>
    <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
    <Link href="/about">
      <a style={linkStyle}>About</a>
    </Link>

    <style jsx>{
        `
        .wrap-header {
            height: 50px;
            width: 100%;
            display: flex;
            align-item: center;
            background-color: lightgreen;
        }

        `
        }</style>
  </div>

);

export default Header;
